package com.switchd;
import java.util.*;
public class table {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        Scanner scan = new Scanner(System.in);
        int t = scan.nextInt();
        
        for(int i=1;i<=20;i++) {
        	System.out.println(t+" x "+i+" = "+t*i);
        }
	}

}
